import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useNutrition } from '../context/NutritionContext';
import { calculateRequirements, saveUserRequirements } from '../utils/api';

const Calculator = () => {
  const navigate = useNavigate();
  const { setUserRequirements } = useNutrition();
  const [formData, setFormData] = useState({
    gender: 'male',
    age: '',
    heightCm: '',
    weightKg: '',
    activityLevel: 'sedentary'
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [results, setResults] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const calculatedResults = await calculateRequirements(formData);
      setResults(calculatedResults);

      const userData = {
        ...formData,
        requirements: calculatedResults
      };
      
      const userResponse = await saveUserRequirements(userData);
      
      if (userResponse?._id) {
        localStorage.setItem('userId', userResponse._id);
      }
      
      setUserRequirements(calculatedResults);
    } catch (err) {
      console.error('Calculator error:', err);
      setError(err.userMessage || 'Failed to calculate. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleNavigateToFoodSearch = () => {
    navigate('/food-search');
  };

  const getBMICategory = (bmi) => {
    if (bmi < 18.5) return { text: 'Underweight', color: 'text-yellow-600' };
    if (bmi < 25) return { text: 'Normal weight', color: 'text-green-600' };
    if (bmi < 30) return { text: 'Overweight', color: 'text-orange-600' };
    return { text: 'Obese', color: 'text-red-600' };
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-green-50 to-white py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-4xl mx-auto">
        <div className="bg-white rounded-2xl shadow-xl overflow-hidden">
          <div className="px-6 py-8 sm:p-10">
            <div className="text-center mb-10">
              <h2 className="text-3xl font-extrabold text-green-800 mb-3">Calculate Your Daily Requirements</h2>
              <p className="text-lg text-gray-600">
                Let's start by calculating your daily caloric and macro requirements.
                After this, you'll be able to search and track your food intake.
              </p>
            </div>
            
            <form onSubmit={handleSubmit} className="space-y-8">
              <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
                <div className="space-y-6">
                  <div className="relative">
                    <label className="block text-sm font-semibold text-gray-700 mb-2">
                      Gender
                    </label>
                    <select
                      name="gender"
                      value={formData.gender}
                      onChange={handleChange}
                      className="w-full p-3 border-2 border-gray-200 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent transition-all"
                      required
                    >
                      <option value="male">Male</option>
                      <option value="female">Female</option>
                    </select>
                  </div>

                  <div className="relative">
                    <label className="block text-sm font-semibold text-gray-700 mb-2">
                      Age
                    </label>
                    <input
                      type="number"
                      name="age"
                      value={formData.age}
                      onChange={handleChange}
                      min="1"
                      max="120"
                      className="w-full p-3 border-2 border-gray-200 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent transition-all"
                      required
                    />
                  </div>

                  <div className="relative">
                    <label className="block text-sm font-semibold text-gray-700 mb-2">
                      Activity Level
                    </label>
                    <select
                      name="activityLevel"
                      value={formData.activityLevel}
                      onChange={handleChange}
                      className="w-full p-3 border-2 border-gray-200 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent transition-all"
                      required
                    >
                      <option value="sedentary">Sedentary</option>
                      <option value="lightly active">Lightly Active</option>
                      <option value="moderately active">Moderately Active</option>
                      <option value="very active">Very Active</option>
                    </select>
                  </div>
                </div>

                <div className="space-y-6">
                  <div className="relative">
                    <label className="block text-sm font-semibold text-gray-700 mb-2">
                      Height (cm)
                    </label>
                    <input
                      type="number"
                      name="heightCm"
                      value={formData.heightCm}
                      onChange={handleChange}
                      min="1"
                      className="w-full p-3 border-2 border-gray-200 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent transition-all"
                      required
                    />
                  </div>

                  <div className="relative">
                    <label className="block text-sm font-semibold text-gray-700 mb-2">
                      Weight (kg)
                    </label>
                    <input
                      type="number"
                      name="weightKg"
                      value={formData.weightKg}
                      onChange={handleChange}
                      min="1"
                      className="w-full p-3 border-2 border-gray-200 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent transition-all"
                      required
                    />
                  </div>
                </div>
              </div>

              <div className="flex flex-col sm:flex-row gap-4 mt-8">
                <button
                  type="submit"
                  disabled={loading}
                  className="flex-1 bg-gradient-to-r from-green-600 to-green-700 text-white py-4 px-6 rounded-xl hover:from-green-700 hover:to-green-800 transition-all disabled:opacity-50 text-lg font-semibold shadow-lg hover:shadow-xl disabled:cursor-not-allowed transform hover:-translate-y-0.5"
                >
                  {loading ? (
                    <span className="flex items-center justify-center">
                      <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                        <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                        <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                      </svg>
                      Calculating...
                    </span>
                  ) : 'Calculate Requirements'}
                </button>

                {results && (
                  <button
                    type="button"
                    onClick={handleNavigateToFoodSearch}
                    className="flex-1 bg-gradient-to-r from-blue-600 to-blue-700 text-white py-4 px-6 rounded-xl hover:from-blue-700 hover:to-blue-800 transition-all text-lg font-semibold shadow-lg hover:shadow-xl transform hover:-translate-y-0.5"
                  >
                    Continue to Food Search
                  </button>
                )}
              </div>
            </form>

            {error && (
              <div className="mt-8 p-4 bg-red-50 border-l-4 border-red-500 rounded-r-lg">
                <div className="flex">
                  <div className="flex-shrink-0">
                    <svg className="h-5 w-5 text-red-400" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                    </svg>
                  </div>
                  <div className="ml-3">
                    <p className="text-sm text-red-700">{error}</p>
                  </div>
                </div>
              </div>
            )}

            {results && (
              <div className="mt-10 space-y-8">
                <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
                  <div className="bg-gradient-to-br from-green-50 to-green-100 rounded-2xl p-8 shadow-lg">
                    <h3 className="text-2xl font-bold text-green-800 mb-6">BMI Results</h3>
                    <div className="space-y-4">
                      <div className="flex justify-between items-center">
                        <span className="text-gray-600 font-medium">Your BMI</span>
                        <span className="text-2xl font-bold text-green-800">{results.bmi.toFixed(1)}</span>
                      </div>
                      <div className="flex justify-between items-center">
                        <span className="text-gray-600 font-medium">Category</span>
                        <span className={`text-lg font-semibold ${getBMICategory(results.bmi).color}`}>
                          {getBMICategory(results.bmi).text}
                        </span>
                      </div>
                    </div>
                  </div>

                  <div className="bg-gradient-to-br from-blue-50 to-blue-100 rounded-2xl p-8 shadow-lg">
                    <h3 className="text-2xl font-bold text-blue-800 mb-6">Daily Calories</h3>
                    <div className="space-y-4">
                      <div className="flex justify-between items-center">
                        <span className="text-gray-600 font-medium">Target Calories</span>
                        <span className="text-2xl font-bold text-blue-800">{Math.round(results.dailyCalories)} kcal</span>
                      </div>
                      <div className="flex justify-between items-center">
                        <span className="text-gray-600 font-medium">Maintenance Level</span>
                        <span className="text-lg font-semibold text-blue-600">
                          {results.dailyCalories > 2500 ? 'High' : results.dailyCalories > 1800 ? 'Moderate' : 'Low'}
                        </span>
                      </div>
                    </div>
                  </div>
                </div>

                <div className="bg-gradient-to-br from-purple-50 to-purple-100 rounded-2xl p-8 shadow-lg">
                  <h3 className="text-2xl font-bold text-purple-800 mb-6">Macro Distribution</h3>
                  <div className="grid grid-cols-1 sm:grid-cols-3 gap-6">
                    <div className="text-center p-4 bg-white rounded-xl shadow">
                      <h4 className="text-lg font-semibold text-purple-800 mb-2">Carbs</h4>
                      <p className="text-2xl font-bold text-purple-600">{Math.round(results.macros.carbsGrams)}g</p>
                      <p className="text-sm text-gray-500">40% of calories</p>
                    </div>
                    <div className="text-center p-4 bg-white rounded-xl shadow">
                      <h4 className="text-lg font-semibold text-purple-800 mb-2">Protein</h4>
                      <p className="text-2xl font-bold text-purple-600">{Math.round(results.macros.proteinGrams)}g</p>
                      <p className="text-sm text-gray-500">30% of calories</p>
                    </div>
                    <div className="text-center p-4 bg-white rounded-xl shadow">
                      <h4 className="text-lg font-semibold text-purple-800 mb-2">Fat</h4>
                      <p className="text-2xl font-bold text-purple-600">{Math.round(results.macros.fatGrams)}g</p>
                      <p className="text-sm text-gray-500">30% of calories</p>
                    </div>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Calculator;
